def get_cat_arrivals(complete_path):
    cat = pd.read_csv(complete_path)
    try:
        filename_to_arrival = {cat.iloc[i].filename: cat.iloc[i]['time_rel(sec)'] for i in range(len(cat))}
    except:
        print(f'Could not parse {complete_path}')
        filename_to_arrival = {}
    return filename_to_arrival


def butter_bandpass(lowcut, highcut, fs, order=3):
    nyquist = 0.5 * fs  # Nyquist frequency
    low = lowcut / nyquist  # Normalize the lowcut frequency
    high = highcut / nyquist  # Normalize the highcut frequency
    b, a = butter(order, [low, high], btype='band', analog=False)  # Filter coefficients
    return b, a


def plot_capture(times, data, filename, atime=None):
    f, (ax1, ax2, ax3, ax4) = plt.subplots(4, 1, figsize=(19.2, 10.8))
    f.suptitle(filename, fontweight='bold')
    # ENVELOPE PREPROCESSING
    fs = 1/(times[1] - times[0])
    b, a = butter(3, 0.01/(0.5 * fs), btype='lowpass', analog=False) # butter_bandpass(0.1, 1, fs)
    envelope = 5*np.abs(data)
    envelope = filtfilt(b, a, envelope)
    # DATA FILTERING
    fs = 1 / (times[1] - times[0])
    b, a = butter_bandpass(0.1, 1, fs)
    data_filtered = filtfilt(b, a, data)
    # DATA PLOTTING
    plot_raw_data(ax1, times, data_filtered, envelope)
    plot_fft(ax2, times, data_filtered)
    plot_spectrogram(ax3, times, data_filtered)
    plot_spectral_content(ax4, times, data_filtered)
    if atime:
        plot_arrival(ax1, atime)
        plot_arrival(ax3, atime)
    plt.subplots_adjust(hspace=0.5)
    return f


def plot_raw_data(ax, times, data, filtered_data):
    sampling_frequency = round(1/(times[1]-times[0]), 2)
    ax.plot(times, data, label=f'Raw data, fs={sampling_frequency}Hz')
    ax.plot(times, filtered_data, label='Filtered data, BP 0.1-1Hz', color='orange', alpha=0.5)
    ax.set_xlim([min(times), max(times)])
    ax.set_ylabel('Velocity (m/s)', fontweight='bold')
    ax.set_xlabel('Time [s]', fontweight='bold')
    ax.set_title(f'Raw data plot', fontweight='bold')
    ax.legend()


def plot_arrival(ax, atime):
    ax.axvline(x=atime, c='red', label='Rel. Arrival')
    ax.legend()


def plot_fft(ax, times, data):
    sampling_period = (times[1] - times[0])
    n = len(times)
    fft_values = np.fft.fft(data)
    magnitude = np.abs(fft_values) / n
    freqs = np.fft.fftfreq(n, d=sampling_period)
    # PLOT ONLY THE POSITIVE F
    positive_magnitude = magnitude[:n // 2]
    positive_freqs = freqs[:n // 2]
    ax.semilogy(positive_freqs, positive_magnitude, label='Fast Fourier Transform')
    ax.set_xlabel('Frequency [Hz]', fontweight='bold')
    ax.set_ylabel('Amplitude', fontweight='bold')
    ax.set_title(f'Frequency content of raw data', fontweight='bold')
    ax.legend()


def plot_spectrogram(ax, times, data):
    sampling_frequency = 1/(times[1] - times[0])
    f, t, sxx = signal.spectrogram(data, sampling_frequency)
    vals = ax.pcolormesh(t, f, sxx, cmap=cm.jet, norm=LogNorm(vmin=np.max(sxx)/1000, vmax=np.max(sxx)))  #, vmax=5e-17)
    ax.set_xlim([min(times), max(times)])
    ax.set_xlabel(f'Time [s]', fontweight='bold')
    ax.set_ylabel('Frequency [Hz]', fontweight='bold')
    cbar = plt.colorbar(vals, orientation='horizontal')
    cbar.set_label('Power ((m/s)^2/sqrt(Hz))', fontweight='bold')
    ax.set_title(f'Spectrogram', fontweight='bold')


