            image_path = PARSED_FILES_ROOT+relative_root+fname+'.png'
            print(f'Saving image {image_path}')
            if not os.path.exists(PARSED_FILES_ROOT+relative_root):
                os.makedirs(PARSED_FILES_ROOT+relative_root)
            plt.savefig(image_path)
            plt.close(figure)

